import axios from "axios";

export default (req, res) => {
  axios
    .get("https://weather-api.endigo.now.sh/api/v1/weather")
    .then(response => {
      const data = response.data.Cities.map(city => {
        const key = cityNameMap[city.Name];
        return {
          key,
          image: imageKeyMap[key],
          name: city.Name,
          weathers: city.Weathers
        };
      });

      const city = data.find(city => city.key === req.query.id);
      if (city) {
        res.json(city);
      } else {
        res.status(404).send("Not found");
      }
    })
    .catch(e => res.status(400).send(e.message));
};

